import React from 'react';
import './App.css';
import logo from './logo.svg';
var url = 'localhost:3000'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          roosa aurora
        </p>
        <a
          className="App-link"
          href={url + "#test"}
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <body>
        <div className="parallax">
          <p>hello this is a test div</p>
        </div>
      </body>
    </div>
  );
}

export default App;
